	render(){
		return(
			<Layout>
				<Message success
    				header='Your Bid Details are successfully added to Blockchain '
    				content='Please mail your Documents To Given Email Below'
  				/>

  				<br/>
  				<br/>
  				<Message info
    				header='kowsikgelli@gmail.com'
  				/>
  			</Layout>
			)
	}
}
export default adminDetails
